/* imports */
import React, { Component } from 'react'
import { useEffect } from 'react'
import styled from 'styled-components'
/* redux */
import { useSelector } from 'react-redux'
/* socketio */
import { socket } from '../components/Socket'
const Background = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  position: absolute;
  top: 0;
  left: 0;
  background: #000;
`
const Text = styled.div``
/* unity webgl */
import dynamic from 'next/dynamic'

const {
  Unity: { UnityContext },
} = dynamic(() => import('react-unity-webgl'), { ssr: false })

const unityContext = new UnityContext({
  loaderUrl: 'build/test-build-for-react.data.loader.js',
  dataUrl: 'build/test-build-for-react.data.data',
  frameworkUrl: 'build/test-build-for-react.data.framework.js',
  codeUrl: 'build/myunityapp.wasm',
})

const Game = () => {
  return (
    <Background>
      <Text>Game</Text>
      <Unity
        unityContext={unityContext}
        src="/Build/test-build-for-react.json"
        loader="/Build/UnityLoader.js"
      ></Unity>
    </Background>
  )
}

export default Game
